import React from 'react';
import styled from 'styled-components';

export const TheFooter = () => {
  return (
    <Buttons>
      <Button>홈</Button>
      <Button>공연</Button>
      <Button>거리문화제</Button>
      <Button>푸드트럭</Button>
      <Button>정보</Button>
    </Buttons>
  );
};

const Buttons = styled.div`
  background-color: #fafafa;
  display: flex;
  justify-content: center;
  margin-top: 20px;
`;

const Button = styled.button`
  color: #6a7282;
  border: none;
  padding: 10px 20px;
  margin: 0 10px;
  cursor: pointer;
`;
